import React from "react";
import { link, github } from ""

const Footer = () => {
    return(
<footer>
      <a href="https://www.linkedin.com/in/a-spencer-johnson" target="_blank" rel="noopener noreferrer"><img src={link} className="logo-links" />
      </a>
      <a href="https://github.com/Spencerj1297" target="_blank" rel="noopener noreferrer"><img src={github} className="logo-links" />
      </a>
      </footer>
    )
}
export default Footer
